description:
***********************************

Ei_Ei's erotic Minecraft paintings.

***********************************
***********************************


I retextured the paintings so that 
they would be erotic but not porn.
Some may disagree and say that this
is porn all the same, but I don't 
think so, and you don't have to use
the textures or look at them if you
don't like them. I just made them 
for my own amusement and decided to
share in case someone else wants to
try the textures.

This is a texture replacer. But you 
can Always take backup of your 
current paintings if want to keep 
them Before overwriting with these.

README is included.
the .png is 4096x4096, makes the 
images very good quality in-game

